full_reasoning:
Step-by-step reasoning:

1. Key Psychological Mechanisms:
   • Responders gain utility from the money they receive. This is represented by the monetary offer (split_self).
   • Responders compare the monetary offer against a fairness norm based on the relative token contributions. Specifically, the fairness norm is defined as the participant’s share of the combined earnings (i.e. combined_earning * [token_self/(token_self + token_opp)]).
   • When the offer is below this fairness reference, a disutility is incurred. To capture the idea that the displeasure increases more than linearly with the shortfall, we use a quadratic (squared) penalty.

2. How These Mechanisms Interact:
   • The utility has two parts: a positive component (the weighted monetary offer) and a negative component (a quadratic penalty when the offer falls below the fair share). When the offer is equal to or above the fairness norm, only the monetary benefit counts.

3. Mathematical Form:
   • Let fair_share = combined_earning × (token_self / (token_self + token_opp)).
   • The discrepancy is computed as (fair_share − split_self). Only when split_self is less than fair_share does the difference matter.
   • The utility function becomes a weighted sum: U_responder = delta * split_self − phi * [max(fair_share − split_self, 0)]².

4. Learnable Parameters:
   • delta: The effective monetary sensitivity parameter scaling the offer’s benefit. Its range is finite (e.g., [0, 10]).
   • phi: The fairness penalty parameter that quadratically penalizes deviations below the fairness norm. Its range is also finite (e.g., [0, 10]).

5. Mapping to Observable Behavior:
   • The observed variable split_self directly contributes to the utility if the offer is accepted.
   • The fairness norm (calculated using combined_earning, token_self, and token_opp) generates a reference resulting in a penalty when the offer is lower than expected. This penalty is scaled by phi.
   • The overall utility (U_responder) will be fed into an action-selection function (outside this model, with a temperature parameter) to obtain choice probabilities.

Below is the formal specification.

<MODEL>
U_responder = delta * split_self - phi * ( max( (combined_earning * token_self / (token_self + token_opp)) - split_self , 0 ) )^2
</MODEL>

